	public int lengthOfLongestSubstring(String s) {
		if (s == null || s.equals("")) {
			return 0;
		} else {
			int maxLength = 0;
			HashMap<Character, Integer> verifiedMap = new HashMap<Character, Integer>();
			int currentLoopStartIndex = 0;
			while(currentLoopStartIndex < s.length()){
				int currentLength = 0;
				int previousRepeatIndex = -1;
				for(int j = currentLoopStartIndex; j < s.length(); j++){
					if(!verifiedMap.containsKey(s.charAt(j))){
						verifiedMap.put(s.charAt(j), j);
						currentLength += 1;
						if(j == s.length() - 1){
							//一直到了字符串尾，记录这次while循环开始的位置
							previousRepeatIndex = j;
						}
					}else{
						previousRepeatIndex = verifiedMap.get(s.charAt(j));
						break;
					}
				}
				verifiedMap = new HashMap<Character, Integer>();
				maxLength = Math.max(maxLength, currentLength);
				currentLoopStartIndex = previousRepeatIndex + 1;
				if(previousRepeatIndex == s.length()){
					//说明已经到了字符串末尾，不可能比现在还大了
					break;
				}
			}
			return maxLength;
		}
	}
